            <div>
                 <div>
                <JqxScrollView ref={this.myScrollView} width={600} height={450} buttonsOffset={[0, 0]}>
                    <div><div className="photo" style={{ backgroundImage: "url(./../Assets/Loginbanner.jpg)" }} /></div>
                    <div><div className="photo" style={{ backgroundImage: "url(./../Assets/Loginbanner.jpg)" }} /></div>
                    <div><div className="photo" style={{ backgroundImage: "url(./../Assets/Loginbanner.jpg)" }} /></div>
                </JqxScrollView>

            </div>
            </div>
        );
    }
}
export default dvLoginScreen;
